const Car = () => {
  return (
    <>
      <h1>My fav Car is BMW 320d</h1>
    </>
  );
};
const Comfunctional = (props) => {
  return (
    <>
      <h1>Functional Component</h1>
      <h2>
        My fav Bike is {props.brand} {props.name}
      </h2>
      <Car />
    </>
  );
};

export default Comfunctional;
